import { Route } from "react-router-dom";
import Home from "./Home.tsx";
import CreateTxn from "./CreateTxn.tsx";

function Main() {
  return (
    <div className="content">
      <Route path="/" component={Home} />
      <Route path="/create-transaction" component={CreateTxn} />
    </div>
  );
}

export default Main;
